import React from 'react';
import s from './Cart.module.css';

const Cart = (props) => {
  const cartItems = <ul></ul>;
  return (
    <div>
      {cartItems}
      <div className={s.total}>
        <span>Итого</span>
        <span>49.99</span>
      </div>
      <div className={s.actions}>
        <button>Закрыть</button>
        <button>Заказать</button>
      </div>
    </div>
  );
};

export default Cart;
